    getKG: () => {
        const allHolds = this.getAllHolds();
        const pzsum = allHolds.reduce((sum, item) => sum + item.z * item.weight, 0) + this.weight * this.z;
        const weightsum = allHolds.reduce((sum, item) => sum + item.weight, 0) + ship.weight;
        return pzsum / weightsum;
    },
